import React from 'react';
import styles from './ProjectsComponent.module.css'
import { Grid, Image, Segment, Header, Divider, Icon, Button } from 'semantic-ui-react'

interface Props {
  name: string
}
export class ProjectsComponent extends React.Component<{}, {}> {

  constructor(props: {}) {
    super(props)
  }

  render() {
    return (
      <>
        <Segment raised className={styles.ProjectsContainer}>
          <Header as='h2' icon className={styles.ProjectsHeader}>
            <Icon name='settings' />
            Account Settings
            <Header.Subheader>
              Manage your account settings and set e-mail preferences.
            </Header.Subheader>
          </Header>
        </Segment>
      </>
    )
  }
}
